function gl_counter(eventId, isCumulative) {
	if (isCumulative == undefined) {
		isCumulative = true;
	}
	Enabler.counter(eventId, isCumulative);
}

function gl_exit(name, url) {
	console.log(String.format('[ gl_exit ] name={0}, url={1}', name, url));
	Enabler.exitOverride(name, url);
}

function gl_get(url, onSuccess, onError) {
	var xmlhttp = new XMLHttpRequest();
	xmlhttp.onreadystatechange = function() {
		if (xmlhttp.readyState == 4) {
			switch (xmlhttp.status) {
				case 200:
					onSuccess(xmlhttp.responseText);
					break;
				default:
					if (onError) {
						onError(xmlhttp);
					}
					break;
			}
		}
	};
	xmlhttp.open('GET', url, true);
	xmlhttp.send();
}

function gl_getParameter(name) {
	var val = Enabler.getParameter(name);
	if (val == null) {
		console.log('Enabler.getParameter returned null for', name);
		try {
			val = decodeURIComponent((new RegExp('[?|&]' + name + '=' + '([^&;]+?)(&|#|;|$)').exec(window.parent.document.location.href) || [, ""])[1].replace(/\+/g, '%20')) || null;
		} catch (e) {
			val = null;
		}
	}
	console.log(name, '=', val);
	return val;
}

function gl_getTestMode() {
	var host = window.location.host;
	var isLocalhost = (host == 'localhost');
	var testMode = '0';
	if (isLocalhost || (host == 'ddlrequest.goodwaygroup.com')) {
		testMode = gl_getParameter('testMode');
	}
	if (testMode == null) {
		testMode = '0';
	}
	return testMode;
}

function gl_getUserZipCode() {
	var zip = Enabler.getParameter("ttdZip");
	if(!zip || zip == undefined || zip == null) {
			zip = Enabler.getUserZipCode();
	}
    
    if (zip == null && window.location.hostname.indexOf("ddlrequest")==0) {
        console.log('Enabler.getUserZipCode returned null');
        zip = gl_getParameter('userZip');
    }
    
	if(zip){
		zip = zip.split('.')[0];
	}
	return zip;
}

function gl_init() {
	var adType = arguments[0];
	var width = arguments[1];
	var height = arguments[2];
	var targetId = arguments[3];
	if (gl_getTestMode() == '1') {
		gl_url = gl_url.replace('cdn', 'ddlrequest');
	} else if(gl_getTestMode() == '0') {
        gl_url = gl_url.replace('TEST/SharedAssets/', "SharedAssets/")
    }
	var isPreview = false;
	var showConsole = false;
	if ((window.location.host == 'ddlrequest.goodwaygroup.com') || (window.location.host == 'localhost')) {
		isPreview = (window.parent.gl_isPreview != undefined) && (window.parent.gl_isPreview === true);
		showConsole = (window.parent.gl_showConsole != undefined) && (window.parent.gl_showConsole === true);
	}
	var jsPath = gl_url + '/js';

	var initPreview = function() {
		if (typeof console != 'undefined') {
			if (typeof console.log != 'undefined') {
				console.olog = console.log;
			} else {
				console.olog = function() {};
			}
		}

		console.log = function() {
			var a = [];
			for (var i = 0; i < arguments.length; i++) {
				a.push(arguments[i]);
			}
			var message = a.join(' ');
			console.olog(message);
			var debug = document.querySelector('.debug-div');
			if (debug) {
				var h = debug.html();
				h += (message + '<br>');
				debug.html(h);
				debug.scrollTop = debug.scrollHeight;
			}
		};

		var t = document.getElementById(targetId);
		var p = t.parentNode;
		p.append(HTMLElement.create('div', {
			'class': 'debug-div'
		}));
	};

	gl_loadScript(jsPath + '/gl_base.min.js', function() {
		gl_loadScript(String.format('{0}/gl_{1}.min.js', jsPath, adType), function() {
			var gl = new GLMobile({
				width: width,
				height: height,
				isDebug: true,
				targetId: targetId,
				dartCampaignId: gl_getParameter('campID') || 0
			});
			gl.init();

			if (isPreview && showConsole) {
				initPreview();
			}

			if (Enabler.isInitialized()) {
				gl.initComplete();
			} else {
				Enabler.addEventListener(studio.events.StudioEvent.INIT, gl.initComplete);
			}
		});
	});
}

function gl_loadHtml(url, target, onSuccess, onError) {
	gl_get(url, function(resultText) {
		console.log('loaded:', url);
		target.html(resultText);
		if (onSuccess) {
			onSuccess(target, resultText);
		}
	}, function(xmlhttp) {
		if (onError) {
			onError(xmlhttp);
		}
	});
}

function gl_loadScript(url, callback) {
	var t = (new Date()).getTime();
	var s = document.createElement('script');
	s.onload = function(e) {
		console.log('loaded:', url);
		if (callback) {
			callback(url);
		}
	};
	s.src = url;
	var h = document.head;
	if (h == undefined) {
		h = document.getElementsByTagName('head')[0];
	}
	h.appendChild(s);
}

function gl_loadStyle(url, callback) {
	var t = (new Date()).getTime();
	var l = document.createElement('link');
	l.onload = function(e) {
		console.log('loaded:', url);
		if (callback) {
			callback(url);
		}
	};
	l.href = url;
	l.rel = 'stylesheet';
	l.type = 'text/css';
	document.head.appendChild(l);
}

function gl_reportCustomVariableCount1(customString) {
	Enabler.reportCustomVariableCount1(customString);
}

function gl_reportCustomVariableCount2(customString) {
    
  _LTracker.push({
		file: 'gl',
		zip: gl_getUserZipCode(),
		method: "gl_reportCustomVariableCount2",
		campaignAdId: gl_getParameter('campaignAdId'),
		value: customString,
		site: gl_getParameter('ttdSite')
	});
    
	Enabler.reportCustomVariableCount2(customString);
}
